import * as React from "react";
import { Checkbox } from "@mui/material";
import { TextField } from "@mui/material";
import './Stylesheets/LoginPage.css';
import { Paper, Button, Box, FormControlLabel, Link } from "@mui/material";
import axios from "axios";

function LoginPage(){
    //Variables describing users credentials
    const [login, setLogin] = useState('');
    const [password, setPassowrd] = useState('');

    //Variables describing alerts
    const [alert, setAlert] = useState(false);
    const [alertType, setAlertType] = useState('');
    const [alertMessage, setAlertMessage] = useState('');

    const handleSubmit = async (event) =>{
        event.preventDefault();

        console.log(login);
        console.log(password);

        await axios.post()


        const data = new FormData(event.currentTarget);
        console.log({
            email: data.get('email'),
            password: data.get('password'),
        });
        console.log("hejka");
    };
    console.log("hej")

    return (<Paper  className="LoginPaper" sx={{width:400}} elevation={3}><Box component="form" action="/login" method="post" sx={{mt:5}} gap={5} display="flex" flexDirection="column" justifyContent="center">
        <h1 className="LogoHeader">Epinote</h1>
        <TextField autofocus label="Login" name="login" id="login" sx={{mr:5, ml:5}} variant="standard" size="small"/>
        <Box sx={{mr:5, ml:5}}>
            <TextField fullWidth label="Password" name="password" id="password" type="password" variant="standard" size="small"/>
            <FormControlLabel control={<Checkbox size="small"/>} label="Remember Me"/>
        </Box>

        <Box sx={{mr:5, ml:5, mb:7}} display="flex" justifyContent="space-between" gap={5}> 
            <Link variant="text" component={Button} underline="none" href='/register'>Create Account</Link>
            <Button  variant="contained" type="submit">Log In</Button>
        </Box>
        </Box></Paper>);
}

export default LoginPage;
